// material design btn
import Ripple from "ripple-button";

const Btn = ({ children, className, onClick }) => {
  return (
    <Ripple
      className={`cursor-pointer ${className} overflow-hidden rounded-md`}
      onClick={onClick}
    >
      {children}
    </Ripple>
  );
};

export default Btn;
